import { Link } from "react-router-dom";
import {useState} from 'react'
import '../../styles/trader.css'
import Charmaleon from '../../assets/charmaleon.png'
import TradeIcon from '../../assets/tradeIcon.png'
import Player from '../../components/Player'

const TradePage = () => {
    const [numPokemonTrade1, setNumPokemonTrade1] = useState([])
    const [numPokemonTrade2, setNumPokemonTrade2] = useState([])

    const ValidTrade1 = () => {
        if(numPokemonTrade1.length < 1 || numPokemonTrade1.length >6){
            alert('Selecione entre 1 e 6 pokemons para troca')
        }
        else{
           numPokemonTrade1.map((index) => {
                return console.log(index)
           });
        }
    } 


    return(
        <div className="TraderGlobalContent">
            <Player numPokemonTrade={numPokemonTrade1} setNumPokemonTrade={setNumPokemonTrade1}/>
            <div className="TraderImgs">
                <img alt="Charmandr Pokemon" src={Charmaleon}/>
                <button 
                    onClick={ValidTrade1}
                >

                </button>
                <img alt="Trade icon" src={TradeIcon} />
            </div>
            <Player numPokemonTrade={numPokemonTrade2} setNumPokemonTrade={setNumPokemonTrade2}/>
        </div>
    )
}

export default TradePage;
